Information
------------------------------

Taboo: Weird Collections
For many, collecting knick knacks or other objects is a hobby; for some, it's a bizarre obsession. Dug, a foot fetishist has over 300 pairs of shoes and 5+ million photographs of feet. While most collectors keep their collection in their home, Lonnie has allowed his collection to become his home. In Turkey, a potter's strange collection is hidden in an underground cave. What started as a childhood hobby for Lawrence has spun out of control forcing him to rely on his parents, and for one man in England, collecting bird ornaments is a full-time hobby.

